let jisx = {};
jisx.table = jistable;

jisx.iso2022 = (m, k, t) => (k + 0x20) * 0x100 + (t + 0x20);
jisx.euc = (m, k, t) => ((k + 0xa0) * 0x100 + (t + 0xa0) + (m == 2 ? 0x8f0000 : 0));
jisx.sjis = (m, k, t) => {
    if (jisx.identify(m, k) == "X0212") return -1;
    const seq = (k - 1) * 94 + (t - 1);
    const c1 = parseInt(seq / 188);
    const c2 = seq % 188;
    const p2 = ((m, k) => {
        if (m != 2) return 0;
        if (k <= 5) return 0x6f;
        if (k <= 15) return 0x6c;
        return 0xd;
    })(m, k);
    return (c1 + (c1 < 31 ? 129 : 193) + p2) * 0x100 + c2 + (c2 < 63 ? 64 : 65);
};
jisx.identify = (m, k, t) => {
    if (!m) return "X0208";
    let level = jisx.level(m, k, t || 1);
    if (level < 0) return "X0212";
    if (level < 3) return "X0208";
    return "X0213";
}

jisx.level = (m, k, t) => {
    let inrange = (v, min, max) => max ? (min <= v && v <= max) : (v == min);
    if (m == 2) return [[1], [3, 5], [8], [12, 15], [78, 94]]
        .some(r => inrange(k, ...r)) ? 4 : -1;

    // case: m == 1
    if ([[9, 15], [85, 94]].some(r => inrange(k, ...r))) return 3;
    const level3 = {
        2: [[15,25], [34,41], [49,59], [75,81], [90,93]],
        3: [[1,15], [26,32], [59,64], [91,94]],
        4: [[84,91]],
        5: [[87,94]],
        6: [[25,32], [57,94]],
        7: [[34,48], [82,94]],
        8: [[33,62], [71,92]],
        47: [[52,94]],
        84: [[07,94]],
    }[k] || [];
    return level3.some(r => inrange(t, ...r)) ? 3 : (k < 48 ? 1 : 2);
};

jisx.search = c => {
    let uni = c.codePointAt(0);
    if (uni < 0x80) return [];
    let jis = Object.keys(jisx.table).map(key => {
        let idx = jisx.table[key].indexOf(uni) + 1;
        return idx ? (key + "_" + ("0" + idx).slice(-2)) : null;
    }).filter(v => v);
    return jis;
};


let onload = () => {
    const $id = e => document.getElementById(e);
    const $new = e => document.createElement(e);
    const $tag = e => [... document.getElementsByTagName(e)];
    const $q = e => [... document.querySelectorAll(e)];
    const $name = e => [... document.getElementsByName(e)];

    const showcode = (codetype, unicode, mkt) => {
        switch(codetype) {
        case "unicode":
            if (!unicode) return "-";
            return (typeof(unicode) == "string") ?
                Array.from(unicode).map(v => "U+" + v.codePointAt(0).toString(16)).join("\n")
                : ("U+" + unicode.toString(16));
        case "kuten":
            return (mkt.filter(e => e).join("-"));
        case "sjis":
            return (jisx.sjis(mkt[0], mkt[1], mkt[2]).toString(16));
        case "iso2022":
            return (jisx.iso2022(mkt[0], mkt[1], mkt[2]).toString(16));
        case "euc":
            return (jisx.euc(mkt[0], mkt[1], mkt[2]).toString(16));
        }
    };

    const redraw = (key) => {
        $id("jistable").innerHTML = "";

        for (let i = 0; i < 6; i++) {
            let $tr = $new("tr");
            $id("jistable").appendChild($tr);
            for (let j = 0; j < 16; j++) {
                $tr.appendChild($new("td"));
            }
        }
        if (!jisx.table[key]) key = "p1_01";

        $q("a.selected").forEach($a => $a.classList.remove("selected"));
        $q("a").find($a => $a.href.split("#").pop() == key).classList.add("selected");

        $q("#jistable td").forEach(($td, idx) => {
            if ((0 < idx) && (idx <= 94)) {
                return draw_char($td,
                                 jisx.table[key][idx - 1],
                                 [(key + "_" + idx)]);
            }
            let $c = $new("span");
            $c.classList.add("c")
            $c.textContent = key.slice(1).split("_").join("面") + "区";
            $td.appendChild($c);
            $td.classList.add("th");
        });
        draw_result();
    };

    const draw_char = ($dom, uni, jis) => {
        $dom.classList.add("JISX");
        let $c = $new("span");
        $c.classList.add('h');
        $dom.appendChild($c);
        
        jis.map((code, i) => {
            let $code = $new("span");
            $code.classList.add('c');
            $dom.appendChild($code);
            let mkt = code.slice(1).split("_").map(e => parseInt(e, 10));
            if (uni) $code.classList.add(jisx.identify(mkt[0], mkt[1], mkt[2]));
            $code.textContent = showcode($name("code").find($radio => $radio.checked).value, uni, mkt);
        });
        
        if (!uni) {
            $c.innerHTML = "<br />";
            $dom.classList.add("undef");
            return;
        }

        if (typeof(uni) == "number") {
            $c.innerHTML = "&#" + uni + ";";
            return;
        }
        $c.textContent = uni;
    };

    const draw_result = () => {
        $id("result").innerHTML = "";
        Array.from($id("search").value).map(c => {
            let jis = jisx.search(c);
            if (jis.length == 0) return;
            let $div = $new("div");
            $id("result").appendChild($div);
            return draw_char($div, c.codePointAt(0), jis);
        });
    };

    const pager = () => {
        $id("pager").textContent = "";

        [1, 2].forEach(men => {
            let $div = $new("div");
            $id("pager").appendChild($div);
            let $h = $new("h4");
            $h.textContent = men + "面";
            $div.appendChild($h);

            for (let i = 0; i < 94; i++) {
                let ku = ("0" + (i + 1).toString()).slice(-2);
                let $a = $new("a");
                $a.textContent = ku;
                $a.setAttribute("href", "#p" + men + "_" + ku);
                $a.classList.add(jisx.identify(men, i + 1));

                $div.innerHTML += " ";
                $div.appendChild($a);
            }
        });
        
        let $div = $new("div");
        $id("pager").appendChild($div);
        let $h = $new("h4");
        $h.textContent = "CP932固有";
        $div.appendChild($h);

        [13, 89, 90, 91, 92, 115, 116, 117, 118, 119].forEach(c => {
            let ku = ("0" + (c).toString()).slice(-3);
            let $a = $new("a");
            $a.textContent = c;
            $a.setAttribute("href", "#w_" + ku);
            $a.classList.add("cp932");

            $div.innerHTML += " ";
            $div.appendChild($a);
        });
    };

    $q("#jistype input").forEach($radio => {
        $radio.onchange = (e) => {
            console.log($name("jiscode"));
            let jiscode = $name("jiscode").find($radio => $radio.checked).value;
            console.log(jiscode);
            $q("#pager a.X0213").forEach($a => $a.style.display = (jiscode == "x0213") ? "" : "none");
            $q("#pager a.X0212").forEach($a => $a.style.display = $id("chx0212").checked ? "" : "none");
        };
    });

    $name("code").forEach($radio => {
        $radio.onchange = () => redraw(location.href.split("#").pop());
    });

    pager();
    redraw(location.href.split("#").pop());
    window.addEventListener('hashchange', () => { redraw(location.href.split("#").pop()); });

    $id("search").onkeydown = function(e) {
        if (e.keyCode != 13) return;
        draw_result();
    };
};

if (typeof window == "undefined" && module) {
    module.exports = jisx;
} else {
    window.onload = onload;
}
